INSERT INTO `blogs` (`id`, `category_id`, `title`, `slug`, `photo`, `description`, `source`, `views`, `status`, `meta_tag`, `meta_description`, `tags`, `created_at`, `updated_at`) VALUES
(1, 1, 'Biblical Archaeology and Israel at War: Lessons From the Fall of France', 'biblical-archaeology-and-israel-at-war-lessons-from-the-fall-of-france', '8620534991701245453.jpg', '<p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\"><span class=\"first-letter\" style=\"float: left; padding-right: 5px; padding-top: 2px; font-weight: 600; color: rgb(20, 54, 93); font-size: 4em; line-height: 1em;\">I</span>n times of war, for a nation to be truly victorious, it must believe in itself and its moral standing. It must have pride and confidence in its history, something that binds its people together. That national history, in turn, helps provide a vision of its destiny.</p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\">Our website is dedicated to history and archaeology—specifically,&nbsp;<em>biblical</em>&nbsp;history and archaeology—something that in large part relates to the history of Israel. We examine archaeological evidence relating to the historicity of the biblical account. We take a positive view of Bible historicity, agreeing with Sir Winston Churchill that the evidence at hand “fortif[ies] the grand simplicity and essential accuracy of the recorded truths which have lighted so far the pilgrimage of man” (<em>Thoughts and Adventures,</em>&nbsp;“Moses: The Leader of a People”).<img src=\"data:image/jpeg;base64,\" data-filename=\"Nelson_Glueck.jpg\" style=\"width: 119.789px; height: 167.879px; float: right;\" class=\"note-float-right\"></p><p><a href=\"https://armstronginstitute.org/enlarge_image?data=eyJpZCI6IjE2MjYiLCJjYXB0aW9uIjoiUHJvZi4gTmVsc29uIEdsdWVjaywg%0AMTk1NiIsImNyZWRpdCI6IlB1YmxpYyBEb21haW4ifQ%3D%3D%0A\" class=\"image-enlarge-link\" target=\"_blank\" title=\"Click to enlarge image\" style=\"background-color: rgb(255, 255, 255); color: rgb(20, 54, 93); width: 820.018px; padding: 0px 80px; font-family: abril-text, serif; font-weight: 600; display: block; font-size: 20px;\"></a></p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\">We agree with the renowned 20th-century archaeologist Prof. Nelson Glueck, who wrote, “It may be stated categorically that no archaeological discovery has ever controverted a biblical reference. Scores of archaeological findings have been made which confirm in clear outline or exact detail historical statements in the Bible” (<em>Rivers in the Desert: A History of the Negev;</em>&nbsp;see&nbsp;<a href=\"https://armstronginstitute.org/384-surprised-by-a-pagan-temple-discovered-near-solomons-not-if-you-read-the-bible\" style=\"color: rgb(20, 54, 93); font-weight: 600;\">here</a>,&nbsp;<a href=\"https://armstronginstitute.org/153-camels-proof-that-the-bible-is-false\" style=\"color: rgb(20, 54, 93); font-weight: 600;\">here</a>&nbsp;and&nbsp;<a href=\"https://armstronginstitute.org/701-top-discoveries-of-2021-held-as-evidence-against-the-bible-except-theyre-not\" style=\"color: rgb(20, 54, 93); font-weight: 600;\">here</a>&nbsp;for some examples of supposed contradiction). We agree with his contemporary Prof. William Foxwell Albright, who wrote, “There can be no doubt that archaeology has confirmed the substantial historicity of Old Testament tradition” (<em>Archaeology and the Religions of Israel</em>). He also wrote, “Discovery after discovery has established the accuracy of innumerable details of the Bible as a source of history” (<em>The Archaeology of Palestine</em>).</p><p><a href=\"https://armstronginstitute.org/enlarge_image?data=eyJpZCI6IjE2MjciLCJjYXB0aW9uIjoiUHJvZi4gVy5GLiBBbGJyaWdodCIs%0AImNyZWRpdCI6IlB1YmxpYyBEb21haW4ifQ%3D%3D%0A\" class=\"image-enlarge-link\" target=\"_blank\" title=\"Click to enlarge image\" style=\"background-color: rgb(255, 255, 255); color: rgb(20, 54, 93); width: 820.018px; padding: 0px 80px; font-family: abril-text, serif; font-weight: 600; display: block; font-size: 20px;\"></a></p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"William_Albright_1957.jpg\" style=\"width: 118.083px; height: 159.761px; float: left;\" class=\"note-float-left\">Naturally, such a positive position on Bible historicity is not ubiquitous. There are numerous differing opinions on the accuracy and correct interpretation of the biblical account in scholarship. But it goes without saying that the question of the faithfulness in which the biblical text has been relayed to us is no moot matter. The Hebrew Bible, or Old Testament, is dear to the hearts of millions of Israelis and Jews, as well as&nbsp;<em>billions</em>&nbsp;of believers worldwide: to Christians, who believe that “the Jews were entrusted with the oracles of God” (Romans 3:2; English Standard Version); to Muslims also, whose Qur’an repeatedly asserts that Allah “did reveal the Torah, wherein is guidance and a light” (Al-Ma’idah 5:44; Pickthall translation); and to numerous others of various religious persuasions besides.</p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\">Amid the&nbsp;<a href=\"https://armstronginstitute.org/964-israel-at-war-an-update-from-jerusalem\" style=\"color: rgb(20, 54, 93); font-weight: 600;\">horrifying events</a>&nbsp;of the past two months, much of the online debate about biblical historicity appears to have gone comparatively quiet. Perhaps not surprisingly. Nobody has an appetite for such content at a time of national desperation. Now is the time for heroes and heroism, not for—as the great wartime leader Churchill said—the speculative and sapping “tomes” of “Dr. Dryasdust” and “Professor Gradgrind.” “We reject, however, with scorn all [their] learned and labored myths that Moses was but a legendary figure,” wrote Churchill.</p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\">Now is a time for anchoring to, and drawing from, the bedrock of heroes and their lessons of old—lessons that mere negative testimony cannot do away with. (As Prof. George Frederick Wright wrote in 1910, following the about-face in scholarship&nbsp;<a href=\"https://armstronginstitute.org/954-finding-the-hittites\" style=\"color: rgb(20, 54, 93); font-weight: 600;\">after the discovery of the Hittite Empire</a>: “When shall we learn the inconclusiveness of negative testimony?”) Dismissiveness is a luxury afforded only by peacetime.</p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\">During such a time of national calamity, and in light of this study of history and academia, lessons from 1940 France come to mind.</p>', NULL, 0, 1, NULL, NULL, NULL, NULL, '2023-11-29 02:10:53');
INSERT INTO `blogs` (`id`, `category_id`, `title`, `slug`, `photo`, `description`, `source`, `views`, `status`, `meta_tag`, `meta_description`, `tags`, `created_at`, `updated_at`) VALUES
(2, 1, 'The ‘Earliest Evidence of Warfare in the Southern Levant’', 'the-earliest-evidence-of-warfare-in-the-southern-levant', '12306231411701245566.jpg', '<p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\"><span class=\"first-letter\" style=\"float: left; padding-right: 5px; padding-top: 2px; font-weight: 600; color: rgb(20, 54, 93); font-size: 4em; line-height: 1em;\">“T</span>he story of the human race is war,” Sir Winston Churchill once stated. “Except for brief and precarious interludes, there has never been peace in the world; and before history began, murderous strife was universal and unending.”</p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\">This week, the Israel Antiquities Authority (<span class=\"smallcaps\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-caps: small-caps; font-variant-alternates: normal; font-variant-position: normal; line-height: 1em; font-size: 1.1em;\">iaa</span>) revealed just that: prehistoric evidence of warfare—the earliest thus far discovered in the southern Levant.</p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"William_Albright_1957.jpg\" style=\"width: 275.348px; height: 199.07px; float: left;\" class=\"note-float-left\">In a press release issued Wednesday, the&nbsp;<span class=\"smallcaps\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-caps: small-caps; font-variant-alternates: normal; font-variant-position: normal; line-height: 1em; font-size: 1.1em;\">iaa</span>&nbsp;announced the discovery and analysis of two large slingstone ammunition caches, dated to the first part of the Chalcolithic period; they were discovered at the large archaeological sites of ‘En Esur (Israel’s northern Sharon Plain) and ‘En Ẓippori (Lower Galilee). The discovery has been recently&nbsp;<a href=\"https://atiqot.org.il/ArticleList.aspx?id=1061\" style=\"color: rgb(20, 54, 93); font-weight: 600;\">published</a>&nbsp;in the&nbsp;<span class=\"smallcaps\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-caps: small-caps; font-variant-alternates: normal; font-variant-position: normal; line-height: 1em; font-size: 1.1em;\">iaa</span>’s latest&nbsp;<em>‘Atiqot</em>&nbsp;journal issue, themed “The Science of Ancient Warfare and Defense.” The article is titled “Up in Arms: Slingstone Assemblages From the Late Prehistoric Sites of ‘En Ẓippori and ‘En Esur,” by Gil Haklay, Hendrik Bron, Dina Shalem, Ianir Milevski and Nimrod Getzov.</p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\">The collection of projectiles from both sites totals 424, almost-identical slingstones made of hard limestone/dolomite, uniform in size, weight and shaping—“a specific biconical aerodynamic form, enabling exact and effective projection,” according to the researchers.</p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\"><a href=\"https://armstronginstitute.org/enlarge_image?data=eyJpZCI6IjI3NjEiLCJjYXB0aW9uIjoiU2xpbmdzdG9uZXMgZnJvbSDigJhF%0AbiBaaXBwb3JpIiwiY3JlZGl0IjoiR2lsIEhha2xheS9Jc3JhZWwgQW50aXF1%0AaXRpZXMgQXV0aG9yaXR5In0%3D%0A\" class=\"image-enlarge-link\" target=\"_blank\" title=\"Click to enlarge image\" style=\"background-color: rgb(255, 255, 255); color: rgb(20, 54, 93); width: 820.018px; padding: 0px 80px; font-weight: 600; display: block;\"></a></p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\">According to the press release, “Similar slingstones have been found at other sites in the country, mainly from the Hula Valley and the Galilee in the north to the northern Sharon, but this is the first time that they have been found in excavations in such large concentrations.” They believe that due to the quantity, this constituted some kind of preparation for large-scale warfare. Together with other discoveries, it also points to these sites as important early regional hubs.</p>', NULL, 0, 1, NULL, NULL, NULL, NULL, '2023-11-29 02:12:46');
