(3, 1, 'Gezer’s Carbon Speaks: Solomonic City After All', 'gezers-carbon-speaks-solomonic-city-after-all', '4988311891701245633.jpg', '<p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\">n the battleground that is the debate over identifying the biblical King Solomon’s city of Gezer, there is one key term: Stratum 8. Does it belong to the high chronology’s 10th century&nbsp;<span class=\"smallcaps\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-caps: small-caps; font-variant-alternates: normal; font-variant-position: normal; line-height: 1em; font-size: 1.1em;\">b.c.e.</span>&nbsp;(thus Solomonic)? Or does it belong to the low chronology’s ninth century&nbsp;<span class=\"smallcaps\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-caps: small-caps; font-variant-alternates: normal; font-variant-position: normal; line-height: 1em; font-size: 1.1em;\">b.c.e.</span>?</p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\">Last week, a new, thorough radiocarbon chronology study of Gezer was published in the scientific journal&nbsp;<em>PLOS ONE.</em>&nbsp;The report, “<a href=\"https://journals.plos.org/plosone/article?id=10.1371/journal.pone.0293119\" style=\"color: rgb(20, 54, 93); font-weight: 600;\">The Chronology of Gezer From the End of the Late Bronze Age to Iron Age II: A Meeting Point for Radiocarbon, Archaeology, Egyptology and the Bible</a>”—composed by Lyndelle Webster, Samuel Wolff, Steven Ortiz, Marcella Barbosa, Cameron Coyle, Gary Arbino, Michael Dee, Quan Hua and Geraldine Jacobsen—was the product of 10 seasons of excavations across more than a decade of field work by the Tandy Institute of Archaeology. And the results have proved remarkable.</p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\">“I wasn’t expecting these results,”&nbsp;<em>Haaretz</em>&nbsp;cites the lead author, Dr. Lyndelle Webster, as saying. “I was expecting later dates, similar to what we see in settlements further north. But something different is going on here that we can’t yet explain.”</p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\"><br></p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\">Gezer’s Stratum 8 features a sudden appearance of additional monumental architecture, including a 27-meter-long&nbsp;<a href=\"https://armstronginstitute.org/957-what-is-a-casemate-wall\" style=\"color: rgb(20, 54, 93); font-weight: 600;\">casemate wall fortification</a>, stone glacis, a large courtyard-type administration building (19 by 12 meters, with at least 15 different attached rooms) and a monumental stairway (and all in the relatively limited part of the tel where excavations of this stratum have taken place).</p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\"><a href=\"https://armstronginstitute.org/enlarge_image?data=eyJpZCI6IjI3MTkiLCJjYXB0aW9uIjoiU29sb21vbmljLXBlcmlvZCBjYXNl%0AbWF0ZSB3YWxsIGxpbmUgYXQgVGVsIEdlemVyIiwiY3JlZGl0Ijoi15nXoten%0A15EifQ%3D%3D%0A\" class=\"image-enlarge-link\" target=\"_blank\" title=\"Click to enlarge image\" style=\"background-color: rgb(255, 255, 255); color: rgb(20, 54, 93); width: 820.018px; padding: 0px 80px; font-weight: 600; display: block;\"></a></p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\">Professor Yadin associated this material with the 10th century&nbsp;<span class=\"smallcaps\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-caps: small-caps; font-variant-alternates: normal; font-variant-position: normal; line-height: 1em; font-size: 1.1em;\">b.c.e.,</span>&nbsp;the&nbsp;<a href=\"https://armstronginstitute.org/685-967-bce-how-the-lynchpin-date-for-solomons-temple-was-determined\" style=\"color: rgb(20, 54, 93); font-weight: 600;\">time period of King Solomon</a>. Later excavators, notably Prof. William Dever, returned for several seasons between the 1960s and ’90s. Their finds essentially corroborated Yadin’s original conclusions.<img src=\"data:image/jpeg;base64,\" data-filename=\"William_Albright_1957.jpg\" style=\"width: 50%; float: right;\" class=\"note-float-right\"></p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\">However, a minimalist camp later emerged, promoting a revised low chronology, seeking to down-date these “Solomonic” remains found at Gezer, Hazor and Megiddo to the&nbsp;<em>ninth</em>&nbsp;century&nbsp;<span class=\"smallcaps\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-caps: small-caps; font-variant-alternates: normal; font-variant-position: normal; line-height: 1em; font-size: 1.1em;\">b.c.e.</span>&nbsp;Chief among this movement was Prof. Israel Finkelstein. Aiming to attribute these constructions to northern Israel’s Omride dynasty, he infamously concluded that the great biblical King Solomon was in reality nothing more than a glorified “<a href=\"https://www.newyorker.com/magazine/2020/06/29/in-search-of-king-davids-lost-empire\" style=\"color: rgb(20, 54, 93); font-weight: 600;\">hillbilly</a>”—“little more than a hill country chieftain … rul[ing] over a marginal, isolated, rural region, with no signs of great wealth or centralized administration.” His rule “extended over no empire, no palatial cities, no spectacular capital” (<em>The Bible Unearthed,</em>&nbsp;pages 190, 238, 143). “The supposed archaeological evidence of the united monarchy was no more than wishful thinking,” he wrote of the early “Solomonic” discoveries at these respective sites (page 235).</p>', NULL, 0, 1, NULL, NULL, NULL, NULL, '2023-11-29 02:13:53');

