(6, 'Inspection and Assessment:', 'inspection-and-assessment', '9858817271692176039.jpg', 2, 'democlient1', '2023-08-01', '<p>The project begins with a thorough inspection of the current roof. Trained roofing professionals assess the condition of the roof, identifying signs of damage, wear and tear, leaks, and other issues. They evaluate the roofing materials, underlying structures, and drainage systems to determine the extent of the necessary repairs and replacements. Based on the assessment and considering the client\'s preferences, budget, and environmental factors, suitable roofing materials are selected. Options may include asphalt shingles, metal, wood, slate, or tile, each with unique features and benefits.<br></p>', 'https://facebook.com', 'https://twitter.com', 'https://linkedin.com', 'https://instagram.com', '2023-08-15', 'http://localhost/latest/roofx', 'democlient1@gmail.com', 'Main Campus', '01976814812'),
(7, 'Client Handover and Education', 'client-handover-and-education', '6877046931692177359.jpg', 2, 'demo3', '2023-08-01', '<p>The project begins with a thorough inspection of the current roof. Trained roofing professionals assess the condition of the roof, identifying signs of damage, wear and tear, leaks, and other issues. They evaluate the roofing materials, underlying structures, and drainage systems to determine the extent of the necessary repairs and replacements. Based on the assessment and considering the client\'s preferences, budget, and environmental factors, suitable roofing materials are selected. Options may include asphalt shingles, metal, wood, slate, or tile, each with unique features and benefits.</p><p>The project concludes with a final walkthrough with the client, where the completed work is presented and any questions are addressed. The client receives guidance on roof maintenance and care to ensure the longevity and performance of the new roofing system.</p><p><br></p><p>In summary, the Roof Replacement and Restoration Project involves a comprehensive approach to improving the structural integrity, functionality, and appearance of a residential roof. Through meticulous planning, skilled execution, and attention to detail, the project aims to provide the client with a reliable and aesthetically pleasing roofing solution that enhances their home\'s value and livability.</p>', 'https://facebook.com', 'https://twitter.com', 'https://linkedin.com', 'https://instagram.com', '2023-08-14', 'http://localhost/latest/roofx/', 'demo3@gmail.com', 'Main Campus', '01750000045');

