INSERT INTO `videos` (`id`, `title`, `slug`, `description`, `video`, `thumbnail`, `status`, `created_at`, `updated_at`) VALUES
(2, 'Outposts Built by King David Discovered in Southern Israel', 'outposts-built-by-king-david-discovered-in-southern-israel', '<p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\"><span class=\"first-letter\" style=\"float: left; padding-right: 5px; padding-top: 2px; font-weight: 600; color: rgb(20, 54, 93); font-size: 4em; line-height: 1em;\">T</span>he Bible states that soon after King David conquered the kingdom of Edom, he established a series of garrisons in the region. But is it true? Have such Davidic-era fortresses been discovered in the territory belonging to biblical Edom?</p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\">For today’s program,&nbsp;<em>Let the Stones Speak</em>&nbsp;host Brent Nagtegaal traveled to Ein Hatzeva, located in southern Israel, to interview Israel Antiquities Authority archaeologist Dr. Tali Erickson-Gini at what she believes is one of the many military outposts dating to King David’s time.</p>', 'https://www.youtube.com/embed/EkA-G_Dk5aA', NULL, 1, '2023-11-29 03:03:50', '2023-11-29 03:03:50'),
(3, 'Did the Massive Copper Mines of Edom Empower the Kingdom of David and Solomon?', 'did-the-massive-copper-mines-of-edom-empower-the-kingdom-of-david-and-solomon', '<p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\"><span class=\"first-letter\" style=\"float: left; padding-right: 5px; padding-top: 2px; font-weight: 600; color: rgb(20, 54, 93); font-size: 4em; line-height: 1em;\">T</span>he size of the kingdom of David and Solomon during the 10th century&nbsp;<span class=\"smallcaps\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-caps: small-caps; font-variant-alternates: normal; font-variant-position: normal; line-height: 1em; font-size: 1.1em;\">b.c.e.</span>&nbsp;is the hottest subject of debate among biblical archaeologists. Most of the time, archaeologists look at the size of architectural remains to determine the monumentality of the kingdom. But not Prof. Erez Ben-Yosef, director of the Central Timna Valley Project. The Timna Valley is the location of the largest copper mining and smelting site in the Levant during this period. Here, the evidence of the copper industry is immense, but the associated dwellings are almost nonexistent.</p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\">On today’s podcast, host Brent Nagtegaal talks to Professor Ben-Yosef about how the copper production site in Timna—as well as the wider Aravah Valley area—could have contributed to the power and wealth of the kingdom of David and Solomon, as well as the Edomites.</p>', 'https://www.youtube.com/embed/49Ox68GJMCA', NULL, 1, '2023-11-29 03:05:07', '2023-11-29 03:05:07'),
(4, 'Mysterious Bedrock Cuts From First Temple Period Jerusalem', 'mysterious-bedrock-cuts-from-first-temple-period-jerusalem', '<p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\"><span class=\"first-letter\" style=\"float: left; padding-right: 5px; padding-top: 2px; font-weight: 600; color: rgb(20, 54, 93); font-size: 4em; line-height: 1em;\">T</span>oday, archaeologists from the longest-running archaeological excavation in Jerusalem announced the discovery of two mysterious bedrock-carved installations dating from the time 100 years after King Solomon—2,800 years ago.</p><p style=\"margin-right: 0px; margin-bottom: 1em; margin-left: 0px; width: 820.018px; padding: 0px 80px; color: rgb(0, 0, 0); font-family: abril-text, serif; font-size: 20px;\"><em>Let the Stones Speak</em>&nbsp;host Brent Nagtegaal went to the excavation to discuss the find with excavation codirector Dr. Yiftah Shalev.</p>', 'https://www.youtube.com/embed/QvbdtEtjpAs', NULL, 1, '2023-11-29 03:05:53', '2023-11-29 03:05:53');

